    false,nt"url": null,nt"notes": "This narrative report for Monomoy National
    Wildlife Refuge outlines Refuge accomplishments from May through August of 1953.
    The report begins by summarizing the weather conditions, water conditions, and food
    and cover during this period. Wildlife- including migratory birds, furbearers, predators,
    rodents, raptors, fish, and disease- is also covered. The Refuge development and
    maintenance section discusses physical developments. A progress report on field
    investigations and applied research is also provided. The public relations section
    of the report describes recreational uses, Refuge visitors, Refuge participation,
    and fishing. N-R forms and photographs are attached.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
